const EditSuperForm = (props) =>{
    return(
        <>
            <form>
                <input type='text' placeholder="Nombre Real"/>
                
                <button onClick={()=>props.setEditar(false)}>Cancelar</button>
            </form>
        </>
    )
}

export default EditSuperForm;
